import React from "react";
import styled from "styled-components";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCheck } from "@fortawesome/free-solid-svg-icons";

const SemesterBlock = ({ text, icon }) => {
  return (
    <SemesterDiv>
      <SemesterTop>{text.number}</SemesterTop>
      <SemesterBottom>
        <SemesterCheck>
          <FontAwesomeIcon icon={faCheck} />
        </SemesterCheck>
        <SemesterCourses>
          <li>{text.course1}</li>
          <li>{text.course2}</li>
          <li>{text.course3}</li>
          <li>{text.course4}</li>
          <li>{text.course5}</li>
          <li>{text.course6}</li>
          <li>{text.course7}</li>
          <li>{text.course8}</li>
        </SemesterCourses>
      </SemesterBottom>
    </SemesterDiv>
  );
};

export default SemesterBlock;

const SemesterDiv = styled.div``;
const SemesterTop = styled.div``;
const SemesterBottom = styled.div``;
const SemesterCheck = styled.div`
  color: #ff6262;
  font-size: 5em;
  display: none;
`;
const SemesterCourses = styled.ul`
  display: flex;
  flex-direction: column;
  list-style: none;
`;
